script: |
  super -f text -I q9865.spq | sort > q9865.out

inputs:
  - name: q9865.spq
    data: |
      SELECT DISTINCT - 63 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1, tab1 (FORMAT parquet) cor2;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q9865.out
    data: |
      -63
